;; gorilla-repl.fileformat = 1

;; **
;;; # gg4clj demo
;;; 
;;; This worksheet demonstrates the usage of gg4clj, a wrapper for R's ggplot2 in Clojure. The code, and full instructions, can be found at https://github.com/JonyEpsilon/gg4clj . This worksheet will not explain the details of operation, but will rather present a few examples to refer to.
;; **

;; @@
(ns gg4clj.demo
  (:require [gorilla-plot.core :as plot]
            [gorilla-repl.html :as html]
            [gg4clj.core :as gg4clj]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; **
;;; Plots are generated by calling `gg4clj/view`. The plot is specified as a Clojure data structure that maps to the R code you want to call. The full description of the mapping can be found in the `README.md` file. Here is a classic example using one of the built in datasets:
;; **

;; @@
(gg4clj/view [:qplot :mpg :hp {:data :mtcars :color [:factor :cyl]}])
