;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; **
;;; Now, bringing everything together for a fuller example. Let's generate some random numbers using the Box-Mueller transform.
;; **

;; @@
(defn b-m
  []
  (let [a (rand)
        b (rand)
        r (Math/sqrt (* -2 (Math/log a)))
        th (* 2 Math/PI b)]
    (* r (Math/cos th))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;gg4clj.demo/b-m</span>","value":"#'gg4clj.demo/b-m"}
;; <=

;; @@
(def g-dat {:g1 (repeatedly 50 b-m) :g2 (repeatedly 50 b-m)})
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;gg4clj.demo/g-dat</span>","value":"#'gg4clj.demo/g-dat"}
;; <=

;; **
;;; And we'll construct a plot of the estimated 2D-density with a harmonious Gorilla REPL colour scheme :-)
;; **

;; @@
(gg4clj/view [[:<- :g (gg4clj/data-frame g-dat)]
              (gg4clj/r+
                [:ggplot :g [:aes :g1 :g2]]
                [:xlim -2 2]
                [:ylim -2 2]
                [:geom_point {:colour "steelblue" :size 4}]
                [:stat_density2d {:colour "#FF29D2"}]
                [:theme_bw])]
             {:width 5 :height 5})
